		subtitle_id = 1231,
		id = 10221231,
		chara_id = 1022
	},
	[10221241] = {
		content = "很多人都渴望登上舞台，但那其实不是个好地方。等到灯光熄灭、观众离去，巨大的空洞就会吞没聚光灯下的一切喜悦；对下一场演出的期待和焦虑，也会渐渐吞没你。那是个无底的深渊。",
