		id = 10601211,
		chara_id = 1060
	},
	[10601221] = {
		content = "来天禄贸易之前，我还当过一段时间的警员，我之前说过吗？现在虽然不干了，不过有些习惯倒是留了下来——以至于禄良老板每次都会叮嘱我，不要在任务途中喊什么「都别动，你们被逮捕了。」",
		form_id = 0,
		subtitle_id = 1221,
		id = 10601221,
		chara_id = 1060
	},
	[10601231] = {
		content = "其实很多人都说我固执，我自己也这么觉得。虽然会被说成「犟得九条尾巴都拉不回来」，不过我不认为有自己的坚持是什么坏事。关键在于，有没有把你所想的传达给对方。",
		form_id = 0,
		subtitle_id = 1231,
		id = 10601231,
		chara_id = 1060
	},
	[10601241] = {
		content = "「正义或许会迟到，但从不缺席」……我很讨厌这句话。有些事本应该有更好的结果，然而却因为一些所谓的「正义」与「规则」，最终走向不同的道路……",
