		id = 10611071,
		chara_id = 1061
	},
	[10611081] = {
		content = "虚恒有句古话，「不知真容，只缘其中。」能解开眼前的问题，我不否认你的帮助，所以姑且还是……说声谢谢。但是下次，我会自己解决这些，不用你来操心。",
