		id = 10611191,
		chara_id = 1061
	},
	[10611201] = {
		content = "收下礼物可不代表接受你的心意。不过……咳，如果我这有你想借阅的书，可以随时来找我，我可以破例给你……讲讲。",
		form_id = 0,
