		id = 10611201,
		chara_id = 1061
	},
	[10611211] = {
		content = "四方院的人怕我，我不懂。那些事情明明都简单得很，非要一遍遍给他们解释，谁都会厌烦的吧。好在你还算有点天资，有没有兴趣来当我的助手？",
