		subtitle_id = 1221,
		id = 10611221,
		chara_id = 1061
	},
	[10611231] = {
		content = "有时加班过后在实验室醒来，我会心悸一阵；麟钰与夕雾也一直劝我休息。我当然知道「劳逸结合」的说辞，但在必要的研究完成之前，我不允许自己停下。我想为庚辰分担一些她所背负的，哪怕只有一点点。",
