		subtitle_id = 1231,
		id = 10611231,
		chara_id = 1061
	},
	[10611241] = {
		content = "我要用多少倍的努力，才能与常人齐平；又要达成多高的成就，才能让人不再揶揄我这天生的缺陷……旁人不会懂，也不在乎。他们只在乎我的价值和地位。但你不一样，你好像只在意我本身……是有什么奇怪的癖好吗？",
		form_id = 0,
		subtitle_id = 1241,
		id = 10611241,
		chara_id = 1061
	},
	[10611251] = {
		content = "我不太清楚该如何正确地回应别人对我的关心，他们大多与我接触几次就会被我的沉默渐渐推远。所以我想搞懂你为什么可以不带特殊目的地一直靠近我，虽然这种感觉我并不讨厌……但也不代表我在期待！",
		form_id = 0,
		subtitle_id = 1251,
		id = 10611251,
		chara_id = 1061
