		content = "可能你已经不记得塔琳娜了……她是一位温柔的姐姐。她曾与你一起，告诉我世界的美好，告诉我不要放弃希望，告诉我要积极地活下去。从各种意义上来说……你们带给了我新的生命。",
		form_id = 0,
