		id = 10121061,
		chara_id = 1012
	},
	[10121071] = {
		content = "没想到……会以这样的方式踏出全新的一步。谢谢你，管理员。",
		form_id = 0,
		subtitle_id = 1071,
		id = 10121071,
		chara_id = 1012
	},
	[10121081] = {
		content = "之前我就觉得，好像你总能做出超出想象的事。为了我，值得你付出这么多吗？总之……谢谢。",
		form_id = 0,
		subtitle_id = 1081,
		id = 10121081,
		chara_id = 1012
	},
	[10121091] = {
		content = "或许真的如你所说，我把自己禁锢得太久了，小心翼翼到已经忘了下一步要走向哪里。但好在之后的路有你和我一起，不是吗？",
