		subtitle_id = 1101,
		id = 10121101,
		chara_id = 1012
	},
	[10121111] = {
		content = "新成员？别拖后腿就行。",
		form_id = 0,
		subtitle_id = 1111,
		id = 10121111,
		chara_id = 1012
	},
	[10121121] = {
		content = "天诫十恶，为时除害……我知道自己的职责。",
		form_id = 0,
		subtitle_id = 1121,
		id = 10121121,
		chara_id = 1012
	},
	[10121131] = {
		content = "有需要帮忙的事就直接叫我，只是有些时候我不一定顾得上你。",
		form_id = 0,
		subtitle_id = 1131,
		id = 10121131,
		chara_id = 1012
	},
	[10121141] = {
		content = "我经手的案件大多只有血淋淋的罪恶，至少不会是你想听的话题。",
