		subtitle_id = 1141,
		id = 10121141,
		chara_id = 1012
	},
	[10121151] = {
		content = "接着……怎么？不喜欢吃果冻的话就扔掉吧。",
		form_id = 0,
		subtitle_id = 1151,
		id = 10121151,
		chara_id = 1012
	},
	[10121161] = {
